'use client';
import React, { useRef } from 'react';
import { useData } from '@/app/DataContext';

import html2canvas from 'html2canvas';
import jsPDF from 'jspdf';

import Header from '../../components/header/header';
import Footer from '../../components/footer/footer';
import Canvas from '../../components/canvas/canvas';
import ActiveConstellations from '../../components/activeConstellations/activeConstellations';
import Filters from '../../components/filters/filters';

const Wrapper = ({ constellations, axes, external, about }) => {
  const screenRef = useRef();

  // Context
  const { activeConst, activeFilters } = useData();

  const fontFamilyInjection = (targetElem) => {
    var svgElem = targetElem.getElementsByTagName('svg');
    for (const node of svgElem) {
      node.setAttribute(
        'font-family',
        window.getComputedStyle(node, null).getPropertyValue('font-family')
      );
      node.replaceWith(node);
    }
  };

  const handleDownload = () => {
    const akzidenzFontBase64 =
      '';

    const svg = screenRef.current.getElementsByTagName('svg')[0];
    let defs = document.createElement('defs');

    let styles = document.createElement('style');
    styles.append(
      "@font-face { font-family: 'Akzidenz'; font-weight: bold; src: url(data:application/octet-stream;base64," +
        akzidenzFontBase64 +
        ')}'
    );

    defs.append(styles);
    svg.append(defs);

    const input = screenRef.current;
    fontFamilyInjection(input);
    setTimeout(() => {
      html2canvas(input, { useCORS: true, allowTaint: true }).then((canvas) => {
        try {
          var ctx = canvas.getContext('2d');
          ctx.webkitImageSmoothingEnabled = true;
          ctx.mozImageSmoothingEnabled = true;
          ctx.imageSmoothingEnabled = true;
          const imgData = canvas.toDataURL('image/png');
          const pdf = new jsPDF({ orientation: 'landscape' });

          const padding = 5;
          const gapRectangle = 5;

          // Adding the font to VFS
          pdf.addFileToVFS('./fonts/Akzidenz/AkzidenzBase64.txt', 'Akzidenz');
          // Registering the font in jsPDF
          pdf.addFont(
            './fonts/Akzidenz/AkzidenzGroteskNextBold.otf',
            'Akzidenz',
            'normal'
          );

          // Set the custom font for text
          pdf.setFont('Helvetica', 'bold');

          pdf.addImage(
            imgData,
            'PNG',
            padding,
            0,
            pdf.internal.pageSize.getWidth() - padding * 2,
            (4 * pdf.internal.pageSize.getHeight()) / 5
          );

          // First rectangle - Title
          pdf.setFontSize(10);
          pdf.setFillColor(0, 0, 0);
          pdf.rect(
            padding,
            pdf.internal.pageSize.getHeight() - 15 + 1.5,
            (pdf.internal.pageSize.getWidth() - 2 * padding) / 3 -
              gapRectangle / 2,
            7,
            'F'
          );
          pdf.setTextColor(255, 255, 255);
          pdf.text(
            padding + 1,
            pdf.internal.pageSize.getHeight() - 15 + 6,
            'ETSALS: Learning in constellations'
          );

          // Second rectangle - Active Constellations
          const allActiveConst = activeConst
            .map((item) => item.title)
            .join(', ');
          pdf.setFontSize(7);
          pdf.setFillColor(240, 240, 240);
          pdf.rect(
            padding + (pdf.internal.pageSize.getWidth() - 2 * padding) / 3,
            pdf.internal.pageSize.getHeight() - 15 + 1.5,
            (pdf.internal.pageSize.getWidth() - 2 * padding) / 3 -
              gapRectangle / 2,
            7,
            'F'
          );
          pdf.setTextColor(0, 0, 0);
          const showConstellations =
            allActiveConst.length > 0 ? allActiveConst : 'None';
          pdf.text(
            padding + 1 + (pdf.internal.pageSize.getWidth() - 2 * padding) / 3,
            pdf.internal.pageSize.getHeight() - 15 + 6,
            'Active constellations: ' + showConstellations
          );

          // Third rectangle - Active Filters
          let allActiveFilters = '';
          activeFilters.forEach((af) => {
            const result =
              findNodeById(constellations[0], af) || findNodeById(axes[0], af);
            if (result && result.title) {
              allActiveFilters += result.title + ', '; // Concatenating the title with a comma
            }
          });
          allActiveFilters = allActiveFilters.slice(0, -2);
          pdf.setFillColor(240, 240, 240);
          pdf.rect(
            padding +
              (2 * (pdf.internal.pageSize.getWidth() - 2 * padding)) / 3,
            pdf.internal.pageSize.getHeight() - 15 + 1.5,
            (pdf.internal.pageSize.getWidth() - 2 * padding) / 3 -
              gapRectangle / 2,
            7,
            'F'
          );
          pdf.setTextColor(0, 0, 0);
          pdf.text(
            padding +
              1 +
              (2 * (pdf.internal.pageSize.getWidth() - 2 * padding)) / 3,
            pdf.internal.pageSize.getHeight() - 15 + 6,
            'Active filters: ' +
              (activeFilters.length > 0 ? allActiveFilters : 'None')
          );

          pdf.save('Learning in constellations.pdf');
        } catch (error) {
          console.error('Error generating data URL:', error);
        }
      });
    }, 100); // Adjust the delay as needed
  };

  const findNodeById = (obj, id) => {
    const findInChildren = (node, id) => {
      if (node._id === id) {
        return node; // Found the item with the same id
      }

      if (node.children && node.children.length > 0) {
        for (let child of node.children) {
          const result = findInChildren(child, id);
          if (result) return result;
        }
      }

      return null; // Not found in this node
    };

    // Iterate over the top-level constellations (like Internationalization, Transversality, ...)
    for (let node of obj.children) {
      const foundNode = findInChildren(node, id);
      if (foundNode) {
        return node; // Return the second-level node (like "Internationalization", "Transversality", ...)
      }
    }

    return null; // Not found in any second-level node
  };

  return (
    <div>
      <Header fixed={false} handleDownloadAPP={handleDownload} />
      <ActiveConstellations />
      <Filters constellations={constellations} axes={axes} />
      <Canvas
        ref={screenRef}
        constellations={constellations}
        axes={axes}
        external={external}
        about={about}
      />
      <Footer />
    </div>
  );
};

export default Wrapper;
